INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0.5, 1, 1, 0, 17814, 10, 17814065, 0, 103711, 11, "ええっと、確認なんですけど。\nもしかして、もしかしなくても、\n私の誕生日ケーキってことで\nあってますか？");
INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", "", "", "", 17814, "", 17814066, "", 0, 91, "");
