INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0.5, 1, 1, 0, 18814, 10, 18814071, 0, 101311, 11, "こ、ここ、これはまさか～！？\nナナカちゃん生誕祭の準備！？\n……であってるよね？　単にケーキを\n食べたかっただけとかじゃないよね？");
INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", "", "", "", 18814, "", 18814072, "", 0, 91, "");
