INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", 0, "", "", 18814, 0, 18814090, "", "vo_wac_18814", 21, "vo_wac_18814_004");
