INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", "", "", "", 18814, 1, 18814094, 0.2, 102711, 3, "wac_birthday_eriko_talk_sad");
