INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", 0, "", "", 31114, 0, 31114075, "", "vo_wac_31114", 21, "vo_wac_31114_001");
INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0.5, 1, 1, 0, 31114, 10, 31114076, 0, 100711, 11, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！");
INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES ("", "", "", "", 31114, "", 31114077, "", 0, 91, "");
